import PageTitle from '../../../components/ui/page-title/PageTitle'

export default function Operator(props) {
    const { name } = props

    return (
        <div>
            <PageTitle title={name} />
            <img alt={name} src={`images/ops/portraits/full/${name.toLowerCase()}`} />
        </div>
    )
}
